    [],nt"revision_timestamp": "2015-05-06T21:48:11.222247",nt"name": "multidisciplinary-optimization-object-library-project-06f82",nt"isopen":
    true,nt"url": null,nt"notes": "The development of a library of Common MDO
    Objects is proposed, in which the software objects will automate a variety of recurring
    problems in the development of MDO systems. The focus of the Phase I project was
    development of MDO objects to implement multi-fidelity modeling and simulation within
    MDO systems, and to implement general inter-disciplinary mapping/coupling algorithms
    that can apply to disciplines such as aerodynamics, structures, and thermal. These
    modules will make it much easier to develop MDO applications, as the common issues
    can be solved by simply selecting the appropriate "MDO Object".  In Phase II we
    extend this to the problems of design space exploration, uncertainty quantification,
    and analysis/test correlation, and demonstrate the approach on a set of MDAO problems.rn",nt"license_title":
